import './App.css';
import { Route, Routes, HashRouter } from "react-router-dom";
import NewArtwork from './NewArtwork';
import Home from "./Home";

function App() {
  return (
    <HashRouter>
      < NavBar />
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/newArtwork" element={<NewArtwork />}/>
      </Routes>
    </HashRouter>
  )
}

export default App;
